import React, { useState } from "react";
import { useLocation } from "react-router-dom";

const Project = () => {
    const [pdetails, setPdetails] = useState(null);
    const location = useLocation();
    setPdetails()
    console.log(location.state)
    return(
        <div>
            Project Info
        </div>
    )
}

export default Project;
